import React from "react";

function Booknotes() {
  return (
    <div>
      <nav>
        <a href="/" className="navbar">
          BookNotes
          <a href="/archives" className="btn btn-Light">
            Archives
          </a>
        </a>
      </nav>
    </div>
  );
}

export default Booknotes;
